  Link
} from "react-router-dom";
import Authors from './authors';
import AuthorsDetails from './authorDetails';
const Webpages = () => {
    return(
        <Router>
            <Route exact path="/" component= {Home} />
            <Route path = "/user" component = {AuthorsDetails} />
        </Router>
    );
};
export default Webpages;
